import React, { Component } from "react";
import Movies from "./components/movies";
import "./App.css";

class App extends Component {
  state = {
    movies: getMovies()
  };

  render() {
    return (
      <main className="container">
        <Movies movies={this.state.movies} onDelete={this.handleDelete} />
      </main>
    );
  }
}

export default App;
